        rating: 5,
        text: {
          text: "By far THE best observation point in New York City! Purely because of the height and location.  It was a very clear day we got lucky in November..the viewsto the South were breathtaking. Lady Liberty looking minute in comparison to everything else! The guide / expert was brilliant and presented a thorough and detailed talk about the areas you could see.. the  ports , the buildings,  the Historic Facts  etc . Just wonderful! There's a small coffee bar , toilets etc at the top.. take plenty of photographs it's amazing",
        },
