          text: "You just have to do it! One of the most iconic buildings in the world! I surprised my teenager with a week in NYC and she was in awe of this beautiful building! We went November day after thanksgiving so the city was pretty quiet , the New Yorkers having gone home for the Holidays,  so best time to visit! No queue, and plenty of information on the way up to the top. Once you're up there it's breathtaking.. I  love all the Art Deco , it's just one of the best buildings in the World!",
